import React from "react";
import { Container, Navbar, Nav } from "react-bootstrap";
import "./App.css"; // Import custom CSS file

const Header = () => {
  return (
    <header>
      {/* Background Video */}
      <video
        src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/04/maison-mirabeau-header-2023.mp4"
        autoPlay
        muted
        loop
        className="header-video"
      />

      {/* Image at the bottom right corner */}
      <img
        src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/09/b-corp-logo-en.svg"
        alt="Image"
        className="header-image"
      />

      {/* Navigation Bar */}
      <Navbar expand="lg" className="header-navbar">
        {/* Logo on the far left */}
        <Navbar.Brand href="/" className="header-logo">
          <img src="path/to/logo.jpg" alt="Logo" className="logo-image" />
        </Navbar.Brand>

        {/* Navigation Links */}
        <Nav className="header-nav">
          <Nav.Link href="/">Link 1</Nav.Link>
          <Nav.Link href="/">Link 2</Nav.Link>
          <Nav.Link href="/">Link 3</Nav.Link>
          <Nav.Link href="/">Link 4</Nav.Link>
        </Nav>

        {/* Search Link */}
        <Nav className="header-nav">
          <Nav.Link href="/">Search</Nav.Link>
        </Nav>

        {/* Additional Navigation Links */}
        <Nav className="header-nav">
          <Nav.Link href="/">Link 5</Nav.Link>
          <Nav.Link href="/">Link 6</Nav.Link>
          <Nav.Link href="/">Link 7</Nav.Link>
          <Nav.Link href="/">Link 8</Nav.Link>
        </Nav>
      </Navbar>
    </header>
  );
};

export default Header;
